INSERT INTO `mb_articles` (`id`, `title`, `description`, `category_id`, `order`, `user_id`) VALUES
(1, 'Rule one', 'You must respect the authority and decisions of those with a higher rank. Repeated insubordination and disrespect for authority will result in demotion, return to trial level, or expulsion depending on the severity of the case. The hierarchy is an important part of maintaining the clan and you should at all times obey the senior commanders. Asking for a promotion is not allowed. Promotions are awarded for persistent effort in the eyes of the Generals and the Commander. Their decision is final, you should not question it. If you truly do deserve a promotion, you will get one eventually. Asking for one will set you back several weeks.\r\n', 1, 6, 1),
(4, 'Rule four', 'You must not change your Maximus Brood username or use another without first consulting a Leader. It is preferable that you should not have to change your username at all. Certainly if the reason is just out of personal preference, this will count against you in terms of promotion, because it is confusing to all concerned. To clarify, joining other BW or SC2 clans is strictly forbidden.', 1, 3, 1),
(5, 'Rule five', 'You must try to play an active role within the clan. Those absent for more than a few weeks without due notice will be sacked. Checking the web site for new information and participation in discussions is mandatory. You should not refuse to play tournament or league games if you have signed yourself up to it. Failure to play your games will mean a demotion if there is not a good reason, or at the very least you will not be looked on favourably for a promotion. If you won''t be able to play in a competition, don''t sign up. ', 1, 2, 1),
(6, 'Rule six', 'You have to be able to speak and understand English or at least try hard to improve it, so that you can communicate with your follow clanmates, read and understand clan news aswell as being active on the site and it''s forum. Feel free to join even if your English is very bad, but we expect you to do your best on improving it. Ignoring the clan site and forums because you have a hard time understanding it, will not be tolerated.', 1, 1, 1),
(2, 'Rule two', 'You must never cheat, or use hacks of any kind to distort of unfairly influence the result of a game on battle.net. Failure to comply with this rule will result in demotion for those with medium to high ranks and expulsion for lower ranked members. Loss accounts are also badly frowned upon.', 1, 5, 1),
(3, 'Rule three', 'You must respect your fellow members and must not seriously abuse other people on battle.net whilst representing the clan without due cause. Making trouble on the site is not allowed. Those found to be deliberately making trouble will be suspended from the site. You must also remember some people have a strange sense of humour. Do not take insults aimed as a joke seriously, and do not repeatedly tell tales on other members.', 1, 4, 1),
(7, 'Test 234', '5678', 2, 8, 1),
(8, 'Test567', '234', 2, 7, 1);
