INSERT INTO `mb_categories` (`id`, `title`, `description`, `full`, `category_id`) VALUES
(1, 'Rules', 'The rules provide a framework defining what is expected from members, and equally importantly, what is not! You should study these carefully, for staying on the right side of them will serve you well in your time with the clan.', 1, 0),
(2, 'Test Categories', 'asdfkjghawiulrghvdlksbdosivugbf ', 1, 0);
