(30, 'Tour de France', 'Andre Greipel denied Britain''s Mark Cavendish in a thrilling sprint finish to win stage 10 of the Tour de France, a 158km run from Aurillac to Carmaux.\r\n\r\nGreipel withstood Cavendish''s challenge to win in three hours 31 minutes 21 seconds, as the Briton finished second.\r\n\r\nIt was the first time Cavendish has been beaten by his former HTC teammate in a head-to-head sprint.\r\n\r\nThomas Voeckler retained his race leader''s yellow jersey, one minute 49 seconds ahead of Luis Leon Sanchez.\r\n\r\nCavendish, who won stages five and seven last week, had worked his way into an excellent position coming into the final tight turns of the stage.\r\n\r\nBut Greipel, who left HTC in acrimonious fashion last year, surged back into contention in the final 20 metres to win his first stage at le Tour.a', '2011-07-13 00:46:56', '2011-07-13 00:46:56', 1, 0, 1, 5, 0, 0),
(22, 'Lipsum', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\r\n\r\nwww.google.co.uk', '2011-06-29 18:50:57', '2011-07-28 01:19:59', 1, 0, 1, 5, 0, 0),
