INSERT INTO `mb_ranks` (`id`, `order`, `title`, `description`, `exmember`) VALUES
(4, 8, 'Commander', 'The Commander is the highest and most prestigious rank within the clan. It was introduced in 2002 following a change in leadership. The Commander supersedes the General as the person responsible for maintaining whole clan, both SC and SC2, and making the choices and decisions which will see it prosper. The Commander is personally responsible for sorting out arguments which get out of hand between members, and enforcing the rules as stated on the rules section of the site. Only long standing members with exemplary service records may be promoted to the position of Commander, and they must be aware of the responsibility it entails.', 0),
(5, 5, 'Corporal', 'Corporals are very important for the clan they symbolize steady clan members who have stood out from the crowd. Big things may lie ahead if you just stick to it, take the initiative to go up the ranks!\r\n', 0),
(2, 4, 'Private', 'Congratulations! You achieved it. You are a normal and functional member of our clan. Do you have what it takes to be more then "normal"? Loyalty and activity will help you to advance further from this position...\r\nUsually all members pass this rank, unless they are lured by the "dark side" and join another clan.\r\nAre you with us, or against us, young padawan?...', 0),
(3, 3, 'Trialist', 'A person who is still on trial period for a full [MB] membership. Activity, manners, devotion, attitude and even skill sometimes are considered. This is a very vulnerable position to be in... \r\n', 0),
(6, 7, 'General', 'The rank of General was originally the leading rank in the clan. The rank still holds a huge amount of importance and responsibility. Members can only get to this rank through because active on a very regular basis, and contributing much to the clan on battle.net and on the website forum. The general is expected to support his Commander(s), backing them up and helping to implement their decisions. Generals may also be expected to take on an additional task, such as running a tournament or league. They are also responsible for monitoring the progress of trialists and reporting to the Commander. It is extremely important that Generals are in place to help the Commander with the running of the clan, hence why they''re specific for either Starcraft or Starcraft II. For this reason, inactive Generals will not be tolerated and demoted very quickly. Getting to this rank is all about loyalty, ambition and activity.', 0),
(7, 2, 'Guest', 'an official guest of the clan', 0),
(8, 6, 'Colonel', 'sdfaasdf', 0),
(9, 1, 'Legend', 'Legend of the clan', 1);
